import React from 'react';
import '../ClientFeedBack/ClientFeedBack.css';

const ClientFeedBack = ({client}) => {
    return (
        <div className="col-md- mt-5 customer">
            <div class="card text-white bg-light" style={{maxWidth: '22rem'}}>
                <div class="title">
                    <img src={client.clientImg}alt="customer" style={{width: '50px'}} />
                    <h6 className="card-title text-dark">{client.clientName}</h6>
                </div>
                <div class="card-body">
                    <h5 class="card-title">Primary card title</h5>
                    <p class="card-text">Some quick example text to build on the card title and make up the bulk of the card's content.</p>
                </div>
            </div>

        </div>
    );
};

export default ClientFeedBack;
